import React, { Component } from 'react'
import '../styles/list.sass'

export default class List extends Component {
  state = {
    list: ['hello', 'world']
  }

  render() {
    return (
      <div>
        <ul>
          {this.state.list.map(item => (<li key={item}>{item}</li>))}
        </ul>
      </div>
    );
  }
}
